import React, { useState } from 'react';
import { Link ,Outlet } from 'react-router-dom';


function topNavigationBar() {
    return (
        <div className="topNavigationBar">
            <Link to="/home">Home</Link>
            <Outlet></Outlet>
        </div>
    )
}

export default topNavigationBar
